import React from "react";
import { checkPropTypes } from "prop-types";

// import { Container } from './styles';

export default function Input(props) {
  return (
    <input
      type={props.type}
      onChange={props.onChange}
      value={props.value}
      placeholder={props.placeholder}
    />
  );
}
